Kenya and Minnesota, USA: Update

Nature Documentary hosted by Richard Hammond and Julia Bradbury, published by BBC broadcasted as part of BBC Planet Earth Live series in 2012 - English narration


Information
------------------------------

Planet Earth Live 2012
Richard Hammond and Julia Bradbury are the hosts of this live global wildlife event. For three weeks they will follow the real life and death struggles of baby animals from around the world. It is a critical moment in these young animals' lives, as they try to survive the most challenging month of the year.
Episode 2 Kenya and Minnesota, USA Update
In Kenya, Richard gives the latest on his new born baby elephants and his vulnerable lion cubs, whilst Julia continues to follow the fate of her new baby bear cubs in North America. Look out for the latest reports from Sri Lanka and South Africa on the monkey and meerkat families and behind the scenes insights into how the field teams stay so close to the action around the world.

